const UserWidget = () => {
  const addFriend = () => {
    alert("add");
  };
  return (
    <Box bgcolor={"white"}>
      <Box display="flex" pt="100px">
        <UserImg />
        <Box>
          <Typography>userName</Typography>
          <Typography>_ friends</Typography>
        </Box>
        <PersonAddIcon onClick={addFriend} />
      </Box>
      <Divider />

      <Box>
        <Typography> Location</Typography>
        <Typography> Company</Typography>
      </Box>
      <Divider />

      {/* Who's visited  your profile(neceesary?) */}
      {/* <Box></Box>
      <Divider /> */}

      <Box>
        <Typography variant="heading-1">Social Profiles </Typography>
        {/*  */}
        <Box> </Box>
      </Box>
      <Divider />
    </Box>
  );
};

export default UserWidget;
